import React, { FormEventHandler } from 'react';
import { makeStyles, Typography } from '@material-ui/core';
import { reduxForm, InjectedFormProps } from 'redux-form';
import Form from './components/form_sign_in';
import { IUser } from '../../../interface';


interface IProps extends InjectedFormProps<{}, IProps>{
    onLoginUser(user : IUser, history) : void;
}

const useStyles = makeStyles((theme) => ({

    page: {
        marginTop: theme.spacing(8),
        display : 'flex',
        flexDirection: 'column',
        alignItems : 'center',
    },
}));

export const Sign_In : React.FC<IProps> = ( {
    onLoginUser,
    ...props
}: IProps) => {

    const classes = useStyles();
    return (
            <div className = {classes.page}>
                <Typography variant = 'h5' component = "h1">
                    Авторизация
                </Typography>
                {/* <Form onLoginUser = {onLoginUser} handleSubmit = {handleSubmit}/> */}
            </div>
    )
}

const form = reduxForm<IProps>({
    form: 'auth'
})(Sign_In);

export default form;
